import Projects from "../components/Projects"

const listRouteProjects = [
  { path: "mongodb", elem: <Projects /> }
]

const projectsPI = [
  { name: 'MongoDB', describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb', href: 'https://github.com/rodriguestg/gabriel-rodrigues-mongodb-commerce' },
  { name: 'TFC', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
  { name: 'Ver +', describe: 'Conheça alguns dos principais projetos já concluídos', link: '/portfolio' }
];

const projectsList = [
  { name: 'MongoDB', describe: 'Querys para buscar dados em um banco de dados NoSQL - MongoDb', href: 'https://github.com/rodriguestg/gabriel-rodrigues-mongodb-commerce' },
  { name: 'TFC', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
  { name: 'TFC', describe: 'Simulção de um campeonato, com desenvolvimento de funções backend com servidor MySQL', link: '/tfc' },
];

export {
  projectsPI,
  projectsList,
  listRouteProjects,
}
